import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Inicio from './Inicio';
import FormularioCatequizando from './FormularioCatequizando';

function App() {
    return (
        <Router>
            <div>
                <nav style={styles.navbar}>
                    <h1 style={styles.title}>Church Database Management</h1>
                    <ul style={styles.navLinks}>
                        <li>
                            <Link to="/" style={styles.link}>Inicio</Link>
                        </li>
                        <li>
                            <Link to="/administrar" style={styles.link}>Administrar Catequizandos</Link>
                        </li>
                    </ul>
                </nav>
                <div style={styles.content}>
                    <Routes>
                        <Route path="/" element={<Inicio />} />
                        <Route path="/administrar" element={<FormularioCatequizando />} />
                    </Routes>
                </div>
            </div>
        </Router>
    );
}

const styles = {
    navbar: {
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        padding: '10px 20px',
        backgroundColor: '#4CAF50',
        color: 'white',
    },
    title: {
        margin: 0,
    },
    navLinks: {
        listStyle: 'none',
        display: 'flex',
        gap: '15px',
        margin: 0,
        padding: 0,
    },
    link: {
        color: 'white',
        textDecoration: 'none',
        fontWeight: 'bold',
    },
    content: {
        padding: '20px',
    },
};

export default App;
